import axios from 'axios';
import React from 'react'

class Products extends React.Component {
constructor(props){
    super(props)
    this.state = {data : []}
}
async componentDidMount() {
    const url = "https://60ae0d5e80a61f00173324bc.mockapi.io/products"
    const res = await axios.get(url)
    this.setState({data : res.data})
}

renderUI = () =>{
    console.log(this.state.data)
    return this.state.data.map(el => {
         return <div>{el.id}</div>
    })
}


    render(){
        return (
            this.state.data.map(el => {
                return <div class="product-container">
                <img src={el.image} alt=""/>
                <p class="product-name">{el.name}</p>
                <p>{el.errorDescription}</p>
                <p>ID: <span>{el.id}</span></p>
                <p>Color : <span>{el.color}</span></p>
                <h3>SKU: <span>{el.sku}</span></h3>
                </div>
                 }
            )
        )       
    }

}
export default Products
